International iPad 4G roamers will give AT&T a big bump<br/><br/>When Apple unveiled the new Wi-Fi + 4G iPadon Wednesday, it only announced AT&amp;T, Verizon, and Canadian carriers Bell, Rogers, and Telus as launch partners. Following the announcement, many international readers were quick to point out the device would not work on certain LTE networks from carriers abroad who operate on varying frequency bands. For example, German carriers operate on 800 and 2600 MHz frequency bands, while the new 4G iPad supports only 700 and 2100 MHz frequencies used by both US and Canadian carriers. The good news, at the very least for AT&amp;T, is Apple has confirmed to TheVerge that the new LTE iPad can be used by international roamers on AT&amp;T’s LTE network:Louis Vuitton iPhone 4 Case|Louis Vuitton iPhone 4S Case
<br /><br />iPads sold internationally will be able to connect to AT&amp;Ts LTE network when in the US with the appropriate SIM and plan.
<br />The LTE iPad variant for Verizon only operates on the 700MHz frequency, the same as Canadian carrier Bell’s LTE network. However, Apple’s Canadian online store only lists one model for Canada compatible with both 700 and 2100 MHz bands.Designer iPad 2 Cases|Louis Vuitton iPad 2 Cases
<br /><br />We reported earlier today that shipping estimates for the new iPad were once again beginning to slip, with some stores showing an estimate of March 16-20. International customers, at least in Canada and Australia, are now being greeted with a map during the checkout process showing when their delivery is likely to arrive based on their location. First pointed out by iPadinCanada, you can see an image of the map below:Chanel iPad 2 Cases|Gucci iPad 2 Cases
<br /><br />If your delivery quote reads “Delivers: March 16-March 20?, then your new iPad will deliver on March 16 in major cities and surrounding areas (zone 1). Otherwise, if you live in zone 2, your estimated delivery date is March 19, and if you live in zone 3 your estimated delivery date is March 20. Please add 1-2 additional business days for delivery of personalised products or for zones 4 or 5. If your quote reads “Ships: By March 19?, this map does not apply. You will receive your new iPad within 7 days after shipping.
